import React from 'react';

class GridLayout extends React.Component
{
	constructor(props)
	{
		super(props);
		this.state = {
			var:0
		}
	}

	render()
	{
		return
		(
			<div>
				<h1>From the grid!!</h1>
				{this.state.var}
			</div>
		);
	}
}

export default GridLayout;
